import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  const handleLogout = async () => {
    try {
      // Make a request to your backend to log out the user

      // Redirect the user to the login page or a landing page
      navigate("/"); // or navigate to a landing page
    } catch (error) {
      console.error("Error logging out:", error);
    }
  };

  return (
    <div>
      {/* Navigation Bar */}
      <nav className="navbar navbar-expand-lg navbar-light bg-primary" style={{ background: "#2F71C4" }}>
        <div className="container-fluid">
          <a className="navbar-brand text-white font-weight-bolder" href="#">
            DTE
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link to={"/home"} className="btn btn-primary">
                  Show Jobs
                </Link>'
              </li>
              <li className="nav-item">
                <Link to={"/showjob"} className="btn btn-primary">
                  Show Jobs
                </Link>
              </li>
            </ul>
            <ul className="navbar-nav ml-auto">
              <li className="nav-item">
                <a className="nav-link text-white" href="#">
                  <i className="fas fa-user"></i> Switch User
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link text-white" href="#" onClick={handleLogout}>
                  <i className="fas fa-sign-out-alt"></i> Logout
                </a>
              </li>
            </ul>
          </div>
        </div>
      </nav>

      {/* Home Page Content */}
      <div className="container mt-4">
        <h1>Welcome to the DTE Management Information System</h1>
        <p>This is the home page where you can access various functionalities of the system.</p>
        {/* Add more content or components as needed */}
      </div>
    </div>
  );
};

export default Home;
